import React from 'react';
import logo from './logo.svg';
import './App.css';

function Title(props) {
  return <p>{props.title}</p>
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Title title='Este es el titulo' />
      </header>
    </div>
  );
}

export default App;
